import { LightningElement, api, track } from 'lwc';
import sldsTemplate from "./tree_slds.html";
import ndsTemplate from "./tree_nds.html";

export default class Tree extends LightningElement {
  @api header = "";
  @api items;
  @api theme;
  @api iconUrl;
  _index = 0;

  render() {
    if (this.theme === "nds") {
      return ndsTemplate;
    }
    return sldsTemplate;
  }

}